    movie.title.toLowerCase().includes(searchTerm.toLowerCase())
   );
  return (
    <div  style={{ display: "flex", flexWrap: "wrap", justifyContent: "center" }}>
      
     {  filteredMovies.map((movies)=>(
        <MovieCard key={movies.id} {...movies}  />
        
      ))

     }
    
    </div>
  );
}

